import React from 'react';
import Sdata from './Sdata';
import Card from './Card';
const Netflix=()=>{
    return (
        <Card
       
       key={Sdata[1].id}
        imgsrc={Sdata[1].imgsrc}
        title={Sdata[1].title}
        sname={Sdata[1].sname}
        links={Sdata[1].links} />

       );
}
export default Netflix;
